import React from 'react'
import Im31 from '../Images/shopping-bag.png';

const Afterlogin = () => {
  return (
    <div>
    <div className="main-log-card">
    <img src={Im31} alt="Cart" />
     <h1>Welcome to M-cart</h1>
     <input className='input-f' type="name" placeholder='Enter your name' required/>
     <input className='input-f' type="tell" placeholder='Enter your mobile no.' required/>
     </div>
 </div>
  )
}

export default Afterlogin
